    constructor(props) {
        super(props);
        this.getChannel = this.getChannel.bind(this);
    }

    getChannel = item => {
        return myUrl;
        // let channelName = '';
        // for(let i = 9; i < myUrl.length; i++) {
        //     channelName += 'a';
        // }
        // return channelName;
    }

    render(){
        return (
            <Layout>
                <p>{this.getChannel}</p>
            </Layout>
        )
    }
}

export default Player;
